import React from 'react';
import {  Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    
    <nav className='navbar'>
        <h3 classname="logo">Logo</h3>

        <ul className='nav-links'>
            <Link to="/">

                <li>Home</li>
            </Link>
        </ul>

    </nav>
  )
}
;
export default Navbar
